import { Text,View,StyleSheet,FlatList} from "react-native";
import {Ionicons} from '@expo/vector-icons';
import ChatComp from "../../Components/ChatComp";
import { useEffect ,useState} from "react";
import { GetData } from "../../HttpsReq/HttpData";
function Chats(){

   const [inputData,setInputData]=useState([]);


   useEffect(()=>{
        async function ggg(){
         const hh=await GetData();
         console.log(hh);
         setInputData(hh)
        }

        ggg();
      
   })

   function ourData(itemData){
      return <ChatComp name={itemData.item.id.name}/>
   }
    return(
 <View style={chatStyle.main}> 
    <View style={chatStyle.archivee}>
         <View style={{flexDirection:"row",marginBottom:7}}>
           <Ionicons name="archive" size={23}/>
           <Text style={{marginLeft:6}}>Archived</Text>
         </View>
         <View >
           <Text>count</Text>
        </View>
    </View>

    <FlatList data={inputData} renderItem={ourData} keyExtractor={(item)=>item.id.value} />

 </View>

    )
}

export default Chats;

const chatStyle=StyleSheet.create({
   main:{
      flex:1,
      backgroundColor:"white"
   },
   archivee:{
      marginVertical:10,
      flexDirection:"row",
      justifyContent:"space-between",
      borderBottomWidth:1,
      borderBottomColor:"#c3c3c3"
   }
})
